import React, { useState } from 'react';

function Poke() {
    const [poke, setPoke] = React.useState([]);

    React.useEffect(()=> {
        // const url = 'https://apis.datos.gob.ar/georef/api/provincias?nombre=cordoba';
        const url = 'https://pokeapi.co/api/v2/pokemon-form/1/'; 
        fetch(url).then((response)=>{
            if (response.ok){
                return response.json();
            }else {
                throw response;
            }
        })
        .then((data) => setPoke(data.results))
        .catch((error)=> console.log('Error, provincia no encontrada'));
    }, [])
    return(
        <div>
            {poke?.map(pokemon => {
                return(
                    <div>
                    <h5>{pokemon.name}</h5>
                    <img src={pokemon.front_shiny} />
                    </div>
                );
            })}
        </div>
    )
}

export default Provincias;
